window.bookSummaryJSON = "<p>Follow an unfortunate soul who has been thrown into a fantasy world with nothing. He is quickly railroaded into joining the Legion and has to develop under harsh conditions while slowly discovering his potential power. </p> <p>This story has light LitRPG elements with a stat and magic advancement system. The MC is not overpowered and experiences the pain of growth as he tries to find a place in the strange new world while staying alive. Neither are coming easy to him as his Legion Company is constantly in harm's way.</p>"; 
